import React from 'react';


const List = (props) => {
  return (
    <>
     {/* <h1>Name Lists...</h1> */}
     <ul>
        {props.text.map((i)=>(
            <li>{i}</li>
        ))} 
    </ul>
    </>
  )
}

export default List;
